const Artist = ()=>{
    const [result, setResult] = useState('');
    
    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': 'f1d641037bmsh805777c136ad783p142fecjsn73217d65f347',
            'X-RapidAPI-Host': 'genius.p.rapidapi.com'
        }
    };
      

    
    
    const handleclick =  async ()=>{
        fetch('https://genius.p.rapidapi.com/artists/16775', options)
        .then(response => response.json())
        .then(response => console.log(response))
        .catch(err => console.error(err));

    }





    
    return(
        <div>
            
            <div className="box">
                <div>Artist</div>
                <input>Введи имя или фамилию певца</input>
                <button className="btn" onClick={handleclick}>Button</button>
                
                {/* {response.list}.map(list=><div key={list}>{list}</div> )} */}
                {result}


            </div>
            
        </div>
            
    )
    
   
}

export default Artist;
